import React, { Fragment } from 'react';

// Project Component
import InputProject from './InputProject';
import ListProject from './ListProject';


const ProjectMain = () => {
    return(
        <div>
            <div className={"row"}>
                <InputProject/>
            </div>
            <div className={"row"}>
                <ListProject/>
            </div>
        </div>
    )
}

export default ProjectMain;
